import React from 'react';
import Grid from 'react-bootstrap/es/Grid';
import Card from 'pnnl-react-core/lib/Card';
import Examples from 'Examples';

//var examples = ['1 CIE F1', '2 CIE F2', '3 CIE F3'];
/*
examples.forEach( (option) => {
    console.log('Hello');
    //options.push({label: option, value: option});
    console.log(options);
  });
  */


  var options = examples.map(function (mark, i) {
      return <option
      key={mark.id}
      value={mark.code}>
      {mark.meaning}
      </option>
  });

const About = () => (
  <Grid>
    <br />
    <Card>
      <form>
        <label>
          User:
    <select id="user" name="user">
            <option value="one">1</option>
            <option value="two">2</option>
            <option value="three">3</option>
          </select>
        </label>
        <br />
        <label>
          Commercial:
          <select id="Commercial" name="Commercial">
            <option value="one">1</option>
            <option value="two">2</option>
            <option value="three">3</option>
          </select>
        </label>
        <br />
        <label>
          Example:
          <select id="Example" name="Example">
            <option value="1 CIE F1">1 CIE F1</option>
            <option value="1 CIE F1">2 CIE F2</option>
            <option value="1 CIE F1">3 CIE F3</option>
          </select>
        </label>
        <br />
            <label>
          Example:
        <select options={options.meaning} />
        </label>
      </form>


    </Card>

  </Grid>
);

export default About;
